package com.daniloaraujosilva.mathemagika.library.jvm.common.functions

import com.daniloaraujosilva.mathemagika.library.jvm.common.MathematicaFunction

/**
 *````
 *
 * Name:             Uncompress
 *
 * Full name:        System`Uncompress
 *
 *                   Uncompress["string"] recovers an expression from a compressed string representation generated by Compress.
 * Usage:            Uncompress["string", h] wraps the head h around the expression produced before evaluating it.
 *
 * Options:          None
 *
 * Attributes:       Protected
 *
 *                   local: paclet:ref/Uncompress
 * Documentation:    web: http://reference.wolfram.com/language/ref/Uncompress.html
 *
 * Definitions:      None
 *
 * Own values:       None
 *
 * Down values:      None
 *
 * Up values:        None
 *
 * Sub values:       None
 *
 * Default value:    None
 *
 * Numeric values:   None
 */
fun uncompress(vararg arguments: Any?, options: MutableMap<String, Any?> = mutableMapOf()): MathematicaFunction {
	return MathematicaFunction("Uncompress", arguments.toMutableList(), options)
}
